!(function (e, t) {
  "use strict";
  let n = t.querySelector("#result");
  !(function e() {
    let t = new Date(),
      u = t.getHours(),
      o = t.getMinutes(),
      r = t.getSeconds();
    u < 10 && (u = "0" + u),
      o < 10 && (o = "0" + o),
      r < 10 && (r = "0" + r),
      (n.innerHTML = `${u}:${o}:${r} `),
      setInterval(e, 1e3);
  })();
})(window, document);
